import {Entity, PrimaryGeneratedColumn, Column} from "typeorm";

@Entity("eye_product")
export class EyeProduct {

    @Column("int", {
        nullable: false,
        name: "productId"
    })
    productId: number;

    @Column("varchar", {
        nullable: true,
        length: 255,
        name: "productTitle"
    })
    titleFa: string; // Use the same key as in payloadArray

    @Column("varchar", {
        nullable: true,
        length: 255,
        name: "info"
    })
    info: string | null;

    @Column("varchar", {
        nullable: false,
        length: 12,
        name: "pipelinesIds"
    })
    pipelinesIds: string;

    @Column("timestamp", {
        nullable: true,
        default: () => "CURRENT_TIMESTAMP",
        name: "created_at"
    })
    created_at: Date | null;
}
